# 请保存函数名为main,输入输出均为dict；最终结果会以json字符串方式返回，请勿直接返回不支持json.dumps的对象
import json

def main(params: dict) -> dict:
    try:
        user_input = params.get('json', '{}')
        data = user_input
        max_iterations = 5
        for _ in range(max_iterations):
            if isinstance(data, dict):
                if 'json' in data:
                    data = data['json']
                    continue
                break
            if isinstance(data, str):
                data = data.strip()
                if not data or data == '{}':
                    data = {}
                    break
                try:
                    data = json.loads(data)
                except json.JSONDecodeError:
                    break
            else:
                break
        if not isinstance(data, dict):
            return {
                'analysis_input': str(user_input),
                'userId': '',
                'success': False,
                'message': '解析失败，已回退为原始文本'
            }
        user_id = data.get('userId', data.get('user_id', ''))
        return {
            'analysis_input': json.dumps(data, ensure_ascii=False),
            'userId': user_id,
            'success': True,
            'message': '提取成功'
        }
    except Exception as e:
        return {
            'analysis_input': str(params.get('json', '')),
            'userId': '',
            'success': False,
            'message': f'提取失败: {str(e)}'
        }
